import React from "react";
import "./footer.css";

import {Container, Row, Col, List, ListGroupItem} from "reactstrap";
import {Link} from "react-router-dom";
import logo from "../../assets/images/logo.png";

const quick_links=[
    {
        path: '/home',
        display: 'Home',
    },
    {
        path: '/about',
        display: 'About',
    },
    {
        path: '/tours',
        display: 'Tours',
    },
];

const quick_links2=[
    {
        path: '/gallery',
        display: 'Gallery',
    },
    {
        path: '/login',
        display: 'Login',
    },
    {
        path: '/register',
        display: 'Register',
    },
];

const Footer = () => {
    return (
        <footer className="footer">
             <Container>
                <Row>
                    <Col lg="3">
                        <div className="logo">
                            <img src={logo} alt="" />
                            <p>Travelling is an amazing way to learn a lot of things in life.
                                A lot of people around the world travel every year to many places.
                            </p>

                            <div className="social_links d-flex align-items-center gap-4">
                               <span>
                                  <Link to="#"></Link>
                               </span>
                            </div>
                        </div>
                    </Col>
                </Row>
             </Container>
        </footer>
    )
}

export default Footer;
